import React, { useEffect, useState } from 'react';
import { getTest } from './service';

interface Exam {
  id: string;
  exam_name: string;
  text: string;
  options: string[];
  correctAnswer: string;
}

const ViewTest: React.FC = () => {
  const [exams, setExams] = useState<Exam[]>([]);
  const [testId, setTestId] = useState<string>("abcxyz")

  useEffect(() => {
    const getExam = async () => {
      const exam = await getTest(testId)
    }

    
  }, []);

  return (
    <div className="card p-6 shadow-lg bg-white">
      <h2 className="text-2xl font-bold mb-4">Uploaded Exams</h2>
      <table className="table-auto w-full border-collapse border border-gray-300">
        <thead>
          <tr className="bg-gray-100">
            <th className="border p-2">#</th>
            <th className="border p-2">Exam Name</th>
            <th className="border p-2">Question</th>
            <th className="border p-2">Options</th>
            <th className="border p-2">Correct Answer</th>
          </tr>
        </thead>
        <tbody>
          {exams.map((exam, index) => (
            <tr key={exam.id}>
              <td className="border p-2">{index + 1}</td>
              <td className="border p-2">{exam.exam_name}</td>
              <td className="border p-2">{exam.text}</td>
              <td className="border p-2">{exam.options.join(', ')}</td>
              <td className="border p-2">{exam.correctAnswer}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ViewTest;
